(36, 2, 'White Blood Cell Cast', 0, 0, 0, 0, 0, 0, '', '', '', ''),
(37, 2, 'Granular Cast', 0, 0, 0, 0, 0, 0, '', '', '', ''),
(38, 2, 'Uric Acid Crystal', 0, 0, 0, 0, 0, 0, '', '', '', ''),
(39, 2, 'Calcium Oxalate Crystal', 0, 0, 0, 0, 0, 0, '', '', '', ''),
(40, 2, 'Triple Phosphate Crystal', 0, 0, 0, 0, 0, 0, '', '', '', ''),
(41, 2, '*Amorphous', 0, 0, 0, 0, 0, 0, '', '', '', ''),
(42, 2, '*Mucous Thread', 0, 0, 0, 0, 0, 0, '', '', '', ''),
(43, 3, 'ลักษณะของอุจจาระ (Consistency)', 0, 0, 0, 0, 0, 0, '', '', '', '1. อุจจาระอ่อนนุ่ม (Soft) คือ อุจจาระที่ปกติที่เมื่ออยู่ในภาชนะ ฐานจะแผ่ออกแต่ส่วนบนยังเป็นก้อนอยู่\n2. อุจจาระปกติ (Formed) คือ อุจจาระที่มีรูปร่างเป็นทรงกระบอก ใช้ไม้จิ้มอุจจาระตัดได้\n3. อุจจาระก้อนแข็งมาก (Hard) ส่วนใหญ่มักพบในผู้กินผักน้อย กินเนื้อมาก หรือมีภาวะท้องผูก\n4. อุจจาระเหลว (Loose) คือ อุจจาระที่เมื่อนำไปใส่ภาชนะแล้วเปลี่ยนแปลงรูปทรงได้ตามภาชนะที่บรรจุ แต่ยังมีเนื้ออุจจาระอยู่\n5. อุจจาระเหลวเป็นน้ำ (Watery)'),
(44, 3, 'สีของอุจจาระ (Color)', 0, 0, 0, 0, 0, 0, '', '', '', '1. สีน้ำตาล (Brown) คือสีปกติ อาจแตกต่างกันขึ้นกับอาหารที่รับประทานและสีของอาหาร\n2. อุจจาระสีแดง (Red) สาเหตุมาจากการมีเลือดออกในระบบทางเดินอาหารส่วนปลาย หรือเกิดจากการกินอาหารจำพวกเนื้อวัวในปริมาณมาก\n3. อุจจาระสีดำ (Black) สาเหตุมาจากการมีเลือดออกในระบบทางเดินอาหารส่วนต้น หรือจากการรับประทานอาหารบางชนิด เช่น ธาตุเหล็ก ชาร์โคล\n4. อุจจาระสีเขียว (Green) มีสาเหตุมาจากการกินผักที่มีสีเขียวหรือมีคลอโรฟิลล์สูงหรือเกิดจากอาการท้องเสียอย่างรุนแรง\n5. อุจจาระสีขาว (White) มีสาเหตุมาจากกินแบเรียมหรือกินยาลดกรด\n6. อุจจาระสีเหลือง (Yellow) ถึง เหลืองอมเขียว (Yellow-Green) มีสาเหตุมาจากเด็กทารกที่ขาดแบคทีเรียประจำถิ่นในลำไส้หรือการกินยาปฏิชีวนะที่ทำให้เชื้อแบคทีเรียประจำถิ่นในลำไส้ตายหมด'),
(45, 3, 'เลือด ในอุจจาระ (Blood gross)', 0, 0, 0, 0, 0, 0, '', '', '', 'เลือด (Blood) ปกติจะไม่พบ หากพบ บ่งชี้ว่าอาจจะมีเลือดออกในระบบทางเดินอาหาร'),
(46, 3, 'มูก ในอุจจาระ (Mucus)', 0, 0, 0, 0, 0, 0, '', '', '', 'มูกหรือเยื่อเมือก (Mucus) ปกติจะไม่พบหรือพบได้น้อยมากในระบบทางเดินอาหาร (มองไม่เห็นด้วยตาเปล่า) แต่หากมองเห็นด้วยตาเปล่าได้ก็จะบ่งบอกถึงสิ่งผิดปกติ \nอุจจาระเป็นมูกและมีเลือดปน(Mucus and Bloody) ซึ่งอาจมีสาเหตุมาจากโรคไทฟอยด์ อหิวาต์ บิดมีตัว และมะเร็งลำไส้ใหญ่'),
(47, 3, 'เม็ดเลือดขาว ในอุจจาระ (WBC)', 0, 0, 0, 0, 0, 0, '', '', '', 'หากพบปริมาณมาก บ่งชี้ว่าอาจจะมีการติดเชื้อหรือการอักเสบในระบบทางเดินอาหาร'),
(48, 3, 'เม็ดเลือดแดง ในอุจจาระ (RBC)', 0, 0, 0, 0, 0, 0, '', '', '', 'หากพบปริมาณมาก  บ่งชี้ว่าอาจจะมีเลือดออกในระบบทางเดินอาหาร'),
(49, 3, 'ตรวจหาเลือดในอุจจาระ (Fecal Occult Blood)', 0, 0, 0, 0, 0, 0, '', '', '', 'ผลเป็นบวก บ่งชี้ว่าอาจมีเลือดปนในอุจจาระ ซึ่งพบในโรคที่มีความผิดปกติของลำไส้ เลือดออกทางเดินอาหาร ริดสีดวง ควรเข้ารับคำแนะนำและตรวจเพิ่มเติมกับแพทย์ผู้เชี่ยวชาญ'),
(50, 3, 'ปรสิต ในอุจจาระ (Parasite)', 0, 0, 0, 0, 0, 0, '', '', '', 'มีปรสิตในลำไส้ เช่น ไข่พยาธิ ตัวอ่อนพยาธิ ปล้องพยาธิ โปรโตซัว'),
(51, 3, 'หนอง ในอุจจาระ (Pus)', 0, 0, 0, 0, 0, 0, '', '', '', 'หนอง (Pus) ปกติจะไม่พบ หากพบ บ่งชี้ว่าอาจจะมีการติดเชื้อในระบบทางเดินอาหาร'),
(52, 4, 'ตรวจระดับน้ำตาลในเลือด (Fasting Blood Sugar)', 74, 109, 0, 0, 0, 0, 'mg / dl', 'ระดับน้ำตาลในเลือดต่ำ อาจพบในผู้ทีมีภาวะน้ำตาลต่ำ ผู้ที่มีความผิดปกติของการทำงานของตับอ่อน', 'ระดับน้ำตาลสูง มีโอกาสเกิดโรคเบาหวาน ตับอักเสบเรื้อรัง ภาวะเครียด เป็นต้น แนะนำให้ตรวจติดตามระดับน้ำตาลในเลือดซ้ำ 1-3 เดือน หรือพบแพทย์ผู้เชี่ยวชาญในการวินิจฉัย รวมทั้งควบคุมการทานอาหาร เลี่ยงอาหารผักผลไม้และผลิตภัณฑ์ที่มีรสหวาน', ''),
(53, 4, 'ตรวจระดับน้ำตาลสะสม (Hb A1C)', 4.8, 5.9, 0, 0, 0, 0, '%', '', 'ระดับน้ำตาลสะสมในเลือดที่สูง พบในโรคเบาหวาน หรือสงสัยโรคเบาหวาน  \nข้อควรปฏิบัติ\n1. ปรึกษาแพทย์เพื่อยืนยันการวินิจฉัยหรือปรับเปลี่ยนการรักษาที่เหมาะสมในกรณีที่เป็นโรคเบาหวานอยู่เดิม\n2. ปรับพฤติกรรมการรับประทานอาหาร ลดอาหารประเภทให้พลังงาน เช่น คาร์โบไฮเดรต ไขมัน และน้ำตาล\n3. ลดน้ำหนักด้วยวิธีที่เหมาะสม\n4. ออกกำลังกายหรือเพิ่มกิจกรรมทางกาย  อย่างน้อย 30 นาทีต่อครั้ง ความถี่ 5 ครั้งต่อสัปดาห์ ', ''),
(54, 4, 'Bun', 6, 20, 0, 0, 0, 0, 'mg / dl', 'ระดับ BUN ต่ำ พบได้ในภาวะขาดสารอาหาร โรคตับเรื้อรัง ทั้งนี้ควรมีการประเมินการทำงานของไตร่วมกับระดับ Creatinine', 'ระดับ BUN สูงอาจเกิดจากการรับประทานอาหารโปรตีนสูง และพบในผู้ป่วยโรคไตเรื้อรัง', ''),
(55, 4, 'Creatinine', 0, 0, 0.67, 1.17, 0.51, 0.95, 'mg / dl', '', 'ระดับ Creatinine สูงพบในภาวะร่างกายขาดสารน้ำเฉียบพลัน และผู้ป่วยโรคไตเรื้อรัง ทั้งนี้ควรมีการประเมินการทำงานของไตร่วมกับระดับ BUN และเปรียบเทียบผลตรวจการทำงานไตเดิม', ''),
(56, 4, 'eGFR', 0, 0, 0, 0, 0, 0, '', '', '', ''),
(57, 4, 'Total protein', 6.6, 8.7, 0, 0, 0, 0, 'g / dl', 'ระดับ Total protein ต่ำ พบในผู้ที่มีภาวะขาดโปรตีน ควรรับประทานอาหารที่มีโปรตีนสูง เช่น นม เนื้อสัตว์ เป็นต้น', 'ระดับ Total protein สูง อาจจะพบในภาวะขาดน้ำ โรคมะเร็งเม็ดเลือดขาว', ''),
(58, 4, 'Albumin', 3.5, 5.2, 0, 0, 0, 0, 'g / dl', 'ระดับ Albumin ต่ำ พบในผู้ป่วยโรคตับ และภาวะขาดโปรตีน', 'ระดับ Albumin สูง พบในผู้ที่มีภาวะขาดน้ำ', ''),
(59, 4, 'Globulin', 3.1, 3.5, 0, 0, 0, 0, 'g / dl', 'ระดับ Globulin ต่ำ พบได้ในภาวะขาดโปรตีน ควรรับประทานอาหารที่มีโปรตีนสูง เช่นเนื้อสัตว์ นม เป็นต้น', 'ระดับ Globulin สูง พบในผู้ที่มีภาวะติดเชื้อเป็นเวลานาน ผู้ป่วยโรคตับเรื้อรัง', ''),
(60, 4, 'ALP', 0, 0, 40, 129, 35, 104, 'U/L', '', 'เอนไซม์ตับชนิด ALP ที่สูง แสดงถึงพยาธิสภาพของตับและทางเดินน้ำดี หรือมีพยาธิสภาพใด ๆ เกิดขึ้นที่กระดูก', ''),
(61, 4, 'ALT', 0, 0, 0, 41, 0, 33, 'U/L', '', 'เอนไซม์ตับชนิด ALT ที่สูง แสดงถึงภาวะของเซลล์ตับถูกทำลาย เช่น ผู้ป่วยโรคตับอักเสบ ตับแข็ง ติดเชื้อไวรัสที่ตับ เป็นต้น', ''),
(62, 4, 'AST', 0, 0, 0, 40, 0, 32, 'U/L', '', 'เอนไซม์ตับชนิด AST ที่สูง แสดงถึงภาวะของเซลล์ตับถูกทำลาย เช่น ผู้ป่วยโรคตับอักเสบ ตับแข็ง ติดเชื้อไวรัสที่ตับ ยา สมุนไพร เครื่องดื่มแอลกอฮอล์ เป็นต้น', ''),
(63, 4, 'Cholesterol', 0, 200, 0, 0, 0, 0, 'mg / dl', '', 'ผู้ที่ระดับคอเลสเตอรอลสูงเล็กน้อย แนะนำควบคุมอาหาร เลี่ยงอาหารไขมันสูง และออกกำลังกายอย่างสม่ำเสมอ และตรวจติดตามค่าไขมันทางเลือดเป็นระยะ', ''),
(64, 4, 'Total Bilirubin', 0, 1.2, 0, 0, 0, 0, 'mg / dl', '', 'ระดับบิลลิรูบินสูง พบได้ในผู้ที่รับประทานอาหารที่มีสีเหลืองมากเกินไป ผู้ป่วยโรคตับเรื้อรัง ภาวะซีดจากเม็ดเลือดแดงแตก การกินยารักษาโรคบางชนิดเป็นประจำ', ''),
(65, 4, 'Direct Bilirubin', 0, 0.3, 0, 0, 0, 0, 'mg / dl', '', 'ระดับบิลลิรูบินสูง พบได้ในผู้ที่รับประทานอาหารที่มีสีเหลืองมากเกินไป ผู้ป่วยโรคตับเรื้อรัง ภาวะซีดจากเม็ดเลือดแดงแตก การกินยารักษาโรคบางชนิดเป็นประจำ', ''),
(66, 4, 'Na', 136, 145, 0, 0, 0, 0, 'mmol/L', 'ระดับโซเดียมต่ำ อาจเกิดจากการเสียน้ำและเกลือแร่  ดื่มน้ำมากเกินไป หรือฮอร์โมนผิดปกติ แนะนำส่งตรวจเพิ่มเติมเพื่อหาสาเหตุกับแพทย์ผู้เชี่ยวชาญ', 'ระดับโซเดียมสูง อาจเกิดจากร่างกายขาดน้ำ และพบในผู้ป่วยโรคไตที่ไม่สามารถขับโซเดียมออกจากร่างกายได้ แนะนำส่งตรวจเพิ่มเติมเพื่อหาสาเหตุกับแพทย์ผู้เชี่ยวชาญ', ''),
(67, 4, 'K', 3.4, 4.5, 0, 0, 0, 0, 'mmol/L', 'ภาวะโพแทสเซียมในเลือดต่ำ ภาวะนี้อาจเกิดจากการอาเจียนอย่างหนัก ท้องเสียหลายครั้ง ใช้ยาขับปัสสาวะหรือยาระบายมากเกินไป ทำให้ไตขับโพแทสเซียมออกจากร่างกายมากเกินไป แนะนำส่งตรวจเพิ่มเติมเพื่อหาสาเหตุกับแพทย์ผู้เชี่ยวชาญ', 'ภาวะโพแทสเซียมในเลือดสูง ภาวะนี้เกิดจากความผิดปกติของไต เช่น โรคไตเรื้อรัง/เฉียบพลัน หรือในผู้ป่วยที่ทานอาหารที่มีโพแทสเซียมสูง หากมีระดับไม่สูงมากอาจไม่ก่อให้เกิดอาการผิดปกติ แต่หากสูงมากอาจเกิดภาวะหัวใจเต้นผิดจังหวะ แนะนำส่งตรวจเพิ่มเติมเพื่อหาสาเหตุกับแพทย์ผู้เชี่ยวชาญ', ''),
(68, 4, 'Cl', 98, 107, 0, 0, 0, 0, 'mmol/L', 'ระดับคลอไรด์ต่ำ มักทำให้กล้ามเนื้อเกร็ง ความดันโลหิตต่ำ และผู้ที่มีอาการท้องเสียรุนแรง', 'ระดับคลอไรด์สูง มักทำให้หัวใจเต้นเร็ว อ่อนแรง', ''),
(69, 4, 'CO2', 22, 29, 0, 0, 0, 0, 'mmol/L', 'ระดับคาร์บอนไดออกไซด์ในเลือดที่ต่ำ พบในโรคไตวายระยะเริ่มต้น สภาวะความเป็นกรดจากโรคเบาหวาน สภาวะอดอาหาร ท้องเสียเรื้อรัง โรคตับ แนะนำส่งตรวจเพิ่มเติมเพื่อหาสาเหตุกับแพทย์ผู้เชี่ยวชาญ', 'ระดับคาร์บอนไดออกไซด์ในเลือดที่สูง อาจเกิดจากการอาเจียนอย่างรุนแรงโรคปอดอุดกั้นเรื้อรัง (COPD) การใช้ยาที่มีไบคาร์โบเนต เช่น ยารักษากระเพาะอาหาร โรคหัวใจ น้ำท่วมปอด เป็นต้น แนะนำส่งตรวจเพิ่มเติมเพื่อหาสาเหตุกับแพทย์ผู้เชี่ยวชาญ', ''),
(70, 4, 'ตรวจระดับแคลเซียมในเลือด (Calcium)', 8.6, 10.2, 0, 0, 0, 0, 'mg / dl', 'ระดับแคลเซียมในเลือดต่ำ มักทำให้เกิดอาการชา เหนื่อยล้า ใจสั่น กรณีที่ระดับแคลเซียมต่ำเล็กน้อย ควรรับประทานอาหารที่มีแคลเซียมสูง เช่น นม เนื้อ และผักใบเขียว', 'ระดับแคลเซียมในเลือดสูง มักพบในผู้ที่มีอาการปวดกระดูก กระดูกพรุน', ''),
(71, 4, 'ตรวจระดับแมกนีเซียมในเลือด (Magnesium)', 1.32, 2.14, 0, 0, 0, 0, 'mg / dl', 'ระดับแมกนีเซียมต่ำ มักทำให้มีอาการมือชา หัวใจเต้นเร็ว ควรรับประทานอาหารที่มีแมกนีเซียมสูง ได้แก่ อาหารทะเล ธัญพืช ถั่วเมล็ด เป็นต้น', 'ระดับแมกนีเซียมสูง มักทำให้มีอาการร้อนตามตัว ความดันโลหิตต่ำ', ''),
(72, 4, 'ตรวจระดับฟอสฟอรัสในเลือด (Inorganic Phosphate)', 2.5, 4.5, 0, 0, 0, 0, 'mg / dl', 'ระดับฟอสฟอรัสในเลือดต่ำมักทำให้มีอาการ ปวดกล้ามเนื้อ คลื่นไส้ วิงเวียน เบื่ออาหาร ควรรับประทานอาหารที่มีฟอสฟอรัสสูง ได้แก่อาหารทะเล ธัญพืช ถั่วเมล็ดแห้ง เป็นต้น', 'ระดับฟอสฟอรัสในเลือดสูง มักมีอาการมือจีบ มือชา เหนื่อยล้า', ''),
(73, 4, 'ตรวจระดับคอเลสเตอรอลรวมในเลือด (Total Cholesterol)', 0, 200, 0, 0, 0, 0, 'mg / dl', 'ระดับคอเลสเตอรอลรวมในเลือดต่ำ อาจเกิดจากภาวะทุพโภชนาการ ภาวะดูดซึมอาหารผิดปกติ ภาวะโลหิตจางเรื้อรัง โรคตับ ภาวะต่อมไทรอยด์ทำงานมากเกินไป เป็นต้น', 'ระดับคอเลสเตอรอลรวมในเลือดสูง อาจเกิดจากภาวะไขมันในเลือดสูง การอุดตันของทางเดินน้ำดี ภาวะไทรอยด์ทำงานน้อย ภาวะตับอ่อนอักเสบ การตั้งครรภ์ เบาหวาน เป็นต้น', ''),
(74, 4, 'ตรวจระดับไขมันไตรกลีเซอไรด์ในเลือด (Triglyceride)', 0, 200, 0, 0, 0, 0, 'mg / dl', 'ระดับไขมันไตรกลีเซอไรด์ในเลือดต่ำ อาจเกิดใน ผู้ที่เป็นโรคพันธุกรรมเมตาบอลิก ภาวะทุพโภชนาการ เป็นต้น', 'ระดับไขมันไตรกลีเซอไรด์ในเลือดสูง เกิดจากการทานอาหารจำพวกข้าว แป้งปริมาณที่มากไป รวมถึงพบได้ในคนที่ดื่มสุรา แนะนำให้ควบคุมการทานอาหารกลุ่มข้าว แป้ง ขนมปัง และงดการดื่มสุรา หากค่าสูงมากผิดปกติแนะนำตรวจเพิ่มเติมและติดตามผลเลือดกับแพทย์ผู้เชี่ยวชาญ', ''),
(75, 4, 'ตรวจระดับคอเลสเตอรอลความหนาแน่นสูงในเลือด ไขมันชนิดดี (HDL-cholesterol)', 0, 0, 0, 55, 0, 65, 'mg / dl', 'ระดับคอเลสเตอรอลความหนาแน่นสูง(ไขมันชนิดดี) ในเลือดต่ำ เพิ่มโอกาสและความเสี่ยงในการเกิดภาวะแทรกซ้อนทางหลอดเลือดและหัวใจ เช่น โรคหลอดเลือดสมอง หลอดเลือดหัวใจตีบ เป็นต้น แนะนำควรออกกำลังกายสม่ำเสมอ 3-5 ครั้งต่อสัปดาห์ (30 นาที/ครั้ง) และรับประทานอาหารที่มีไขมันดีในปริมาณที่เหมาะสม อาทิเช่น ไขมันจากพืช ถั่วเปลือกแข็ง', 'ระดับคอเลสเตอรอลความหนาแน่นสูงในเลือดสูง (ไขมันชนิดดี) แสดงถึงภาวะการเผาผลาญอาหารที่ดี สัมพันธ์กับการออกกำลังกาย และการรับประทานอาหารที่มีประโยชน์', ''),
(76, 4, 'ตรวจระดับคอเลสเตอรอลความหนาแน่นต่ำในเลือด ไขมันชนิดไม่ดี  (LDL-cholesterol)', 0, 100, 0, 0, 0, 0, 'mg / dl', 'ปกติ', 'ระดับคอเลสเตอรอลความหนาแน่นต่ำในเลือดสูง (ไขมันชนิดไม่ดี) เพิ่มความเสี่ยงต่อภาวะแทรกซ้อนทางหลอดเลือดและหัวใจ ข้อควรปฏิบัติ\n1. ลดการทานอาหารที่มีไขมันอิ่มตัวสูง เน้นทานอาหารที่มีไขมันต่ำ เช่น ข้าว ถั่ว ธัญพืช งา สาหร่าย เห็ด เต้าหู้ วุ้นเส้น \n2. เลือกวิธีการปรุงอาหารเป็นการต้ม นึ่ง อบ หรือย่าง\n3. ควบคุมน้ำหนักตัวให้อยู่ในระดับมาตรฐาน  \n4. ออกกําลังกายสม่ำเสมอ ต่อเนื่องครั้งละประมาณ 30 นาที อย่างน้อยสัปดาห์ละ 3 - 5 ครั้ง  \n5. งดสูบบุหรี่', ''),
(77, 4, '(VLDL-cholesterol)', 0, 40, 0, 0, 0, 0, 'mg / dl', 'ปกติ', '', ''),
(78, 4, 'ตรวจระดับกรดยูริกในเลือด (Uric acid)', 3.4, 7, 0, 0, 0, 0, 'mg / dl', 'กรดยูริกที่สูงขึ้นเป็นตัวบ่งชี้ภาวะโรคเก๊าท์แต่ทั้งนี้ผู้ป่วยจะมีอาการอักเสบและปวดตามข้อร่วมด้วย', '', ''),
(79, 4, 'Urine Creatinine (U)', 40, 278, 0, 0, 0, 0, 'mg / dl', 'ค่า Creatinine ในปัสสาวะมีค่าน้อยกว่าปกติ อาจเกิดจากประสิทธิภาพในการกรองของเสียลดน้อยลง ทั้งนี้ต้องตรวจค่าการทำงานของไตอื่นๆ ร่วมด้วย หากผิดปกติแนะนำส่งปรึกษาแพทย์ผู้เชี่ยวชาญ', 'ระดับ Urine Creatinine ที่สูงกว่าปกติ อาจพบได้ในโรคกล้ามเนื้อผิดปกติ ภาวะโรคกล้ามเนื้อสลาย เป็นต้น ทั้งนี้ต้องตรวจค่าการทำงานของไตอื่นๆ ร่วมด้วย หากผิดปกติแนะนำส่งปรึกษาแพทย์ผู้เชี่ยวชาญ', ''),
(80, 4, 'Urine Microalbumin (RU)', 0, 20, 0, 0, 0, 0, 'mg/gCre', 'ปกติ', 'Urine Microalbumin สูง พบได้ในภาวะไตเสื่อม หรือโรคเรื้อรังที่ทำให้ประสิทธิภาพการกรองของไตลดลง \nนอกจากนี้ยังพบในภาวะที่ไม่เกี่ยวกับไตเสื่อม เช่น ไข้สูง ปัสสาวะมีเม็ดเลือดแดงปน การติดเชื้อของระบบทางเดินปัสสาวะ หากผิดปกติแนะนำส่งปรึกษาแพทย์ผู้เชี่ยวชาญ', ''),
(81, 4, 'CEA', 0, 5.2, 0, 0, 0, 0, 'ng / ml', 'ปกติ', 'ระดับ CEA ในเลือดสูง สามารถเกิดได้หลายสาเหตุ อาทิเช่น โรคความผิดปกติของลำไส้ มะเร็งลำไส้ใหญ่ การดื่มสุรา โรคตับเรื้อรัง แต่หากระดับ CEA มีค่าสูงมาก แนะนำส่งตรวจเพิ่มเติมเพื่อหาสาเหตุกับแพทย์ผู้เชี่ยวชาญ', ''),
(82, 4, 'AFP', 0, 11.29, 0, 0, 0, 0, 'IU/mL', 'ปกติ', 'ค่า AFP อยู่ในระดับสูงกว่าปกติ มักสัมพันธ์กับความผิดปกติหรือโรคตับเรื้อรัง มะเร็งตับ แต่ทั้งนี้อาจจะสูงในคนปกติได้เช่นกัน แนะนำส่งตรวจเพิ่มเติมเพื่อหาสาเหตุกับแพทย์ผู้เชี่ยวชาญ', ''),
(83, 4, 'PSA', 0, 4, 0, 0, 0, 0, 'ng / ml', 'ปกติ', 'PSA สูง สาเหตุเป็นได้จากความผิดปกติของต่อมลูกหมาก อาทิเช่น ต่อมลูกหมากอักเสบ  ต่อมลูกหมากโต มะเร็งของต่อมลูกหมาก แนะนำส่งตรวจเพิ่มเติมเพื่อหาสาเหตุกับแพทย์ผู้เชี่ยวชาญ', ''),
(84, 4, 'CA 19-9', 0, 39, 0, 0, 0, 0, 'U/mL', 'ปกติ', 'ระดับ CA 19-9 สูง อาจพบได้ในกลุ่มโรคมะเร็งตับอ่อน หรือเกิดจากมะเร็งชนิดอื่น ๆ โรคที่เกี่ยวกับทางเดินน้ำดีอุดตัน ทั้งนี้ไม่ได้จำเพาะในการคัดกรอง หากตรวจพบมีค่าผิดปกติแนะนำส่งตรวจเพิ่มเติมเพื่อหาสาเหตุกับแพทย์ผู้เชี่ยวชาญ', ''),
(85, 4, 'CA 15-3', 0, 34.5, 0, 0, 0, 0, 'U/mL', 'ปกติ', 'ระดับ CA15-3 สูง  อาจพบได้ในมะเร็งหลายชนิด เช่น มะเร็งเต้านม มะเร็งของระบบทางเดินอาหาร มะเร็งตับ เป็นต้น และทั้งนี้ไม่นิยมใช้ในการวินิจฉัยมะเร็งระยะแรกเริ่ม แนะนำส่งพบแพทย์ผู้เชี่ยวชาญในการตรวจเพิ่มเติม', ''),
(86, 4, 'CA 125', 0, 35, 0, 0, 0, 0, 'U/mL', 'ปกติ', 'ระดับ CA 125  สูง อาจพบในผู้ป่วยมะเร็งรังไข่ มะเร็งตับอ่อน มะเร็งปอด มะเร็งของระบบทางเดินอาหาร รวมทั้งผู้ป่วยที่ไม่เกี่ยวกับมะเร็ง เช่น ตั้งครรภ์ การอักเสบของช่องท้อง และอวัยวะภายในช่องท้อง ทั้งนี้ไม่ได้จำเพาะในการคัดกรอง หากตรวจพบมีค่าผิดปกติแนะนำส่งตรวจเพิ่มเติมเพื่อหาสาเหตุกับแพทย์ผู้เชี่ยวชาญ', ''),
(87, 4, 'B-HCG', 0, 10, 0, 0, 0, 0, 'mIU/ml', 'ปกติ', 'B-HCG สูง ส่วนมากพบในหญิงมีครรภ์  ผู้ป่วยครรภ์ไข่ปลาอุก  มะเร็งของรังไข่ และ/หรือ อัณฑะ ทั้งนี้ไม่ได้จำเพาะในการคัดกรอง หากตรวจพบมีค่าผิดปกติแนะนำส่งตรวจเพิ่มเติมเพื่อหาสาเหตุกับแพทย์ผู้เชี่ยวชาญ', ''),
(88, 4, 'FT3', 2.04, 4.4, 0, 0, 0, 0, 'pg / ml', 'FT3 ต่ำ สงสัยภาวะฮอร์โมนไทรอยด์ชนิด FT3 ต่ำ ทั้งนี้ต้องประเมินร่วมกับ TSH หากผิดปกติแนะนำตรวจซ้ำที่ 4-8 สัปดาห์ หรือพบแพทย์ผู้เชี่ยวชาญ', 'FT3 สูง สงสัยภาวะฮอร์โมนไทรอยด์ชนิด FT3 เกิน ทั้งนี้ต้องประเมินร่วมกับ TSH หากผิดปกติแนะนำตรวจซ้ำที่ 4-8 สัปดาห์ หรือพบแพทย์ผู้เชี่ยวชาญ', ''),
(89, 4, 'FT4', 0.93, 1.71, 0, 0, 0, 0, 'ng / dl', 'FT4 ต่ำ สงสัยภาวะฮอร์โมนไทรอยด์ชนิด FT4 ต่ำ ทั้งนี้ต้องประเมินร่วมกับ TSH หากผิดปกติแนะนำตรวจซ้ำที่ 4-8 สัปดาห์ หรือพบแพทย์ผู้เชี่ยวชาญ', 'FT3 สูง สงสัยภาวะฮอร์โมนไทรอยด์ชนิด FT4 เกิน ทั้งนี้ต้องประเมินร่วมกับ TSH หากผิดปกติแนะนำตรวจซ้ำที่ 4-8 สัปดาห์ หรือพบแพทย์ผู้เชี่ยวชาญ', ''),
(90, 4, 'TSH', 0.27, 4.2, 0, 0, 0, 0, 'uIU/ml', 'TSH เป็นฮอร์โมนที่กระตุ้นให้ต่อมไทรอยด์สร้างฮอร์โมนไทรอยด์ ค่า TSH จะขึ้นกับระดับไทรอยด์ฮอร์โมน หาก TSH สูงอาจสัมพันธ์กับภาวะฮอรโมนไทรอยด์ต่ำ หาก TSH ต่ำอาจสัมพันธ์กับภาวะฮอร์โมนไทรอยด์เกิน หากผิดปกติแนะนำตรวจซ้ำที่ 4-8 สัปดาห์ หรือพบแพทย์ผู้เชี่ยวชาญ', '', ''),
(91, 5, 'Anti-HAV IgG', 0, 0, 0, 0, 0, 0, '', '', '', 'การตรวจเลือดดูภูมิคุ้มกันต่อไวรัสตับอักเสบเอ ถ้าให้ผลบวก (positive) แปลผลได้ว่า เคยติดเชื้อมาก่อนและมีภูมิคุ้มกันแล้ว'),
(92, 5, 'HBsAg', 0, 0, 0, 0, 0, 0, '', '', '', 'HBsAg (แอนติเจนไวรัสตับอักเสบบี) ให้ผลบวก แปลว่า ผู้ป่วยติดเชื้อไวรัสตับอักเสบบี อาจเป็นการติดเชื้อเฉียบพลันหรือเรื้อรังก็ได้ แนะนำตรวจเพิ่มเติมและพบแพทย์ผู้เชี่ยวชาญ'),
(93, 5, 'Anti-HBs', 0, 0, 0, 0, 0, 0, '', '', '', 'Anti – HBS (ภูมิคุ้มกันต่อ HBsAg) ให้ผลบวก แปลว่า  ผู้ป่วยมีภูมิคุ้มกันต่อเชื้อไวรัสตับอักเสบบีแล้ว ซึ่งอาจเกิดจากการได้รับวัคซีนหรือเคยติดเชื้อไวรัสตับอักเสบและหายจากโรคแล้ว'),
(94, 5, 'Anti-HBc', 0, 0, 0, 0, 0, 0, '', '', '', 'การตรวจ Anti-HBc ซึ่งเป็นแอนติบอดีต่อ core antigen (HbcAg) ของไวรัส หาก Negative แปลผลว่ายังไม่เคยติดเชื้อ หาก Positive แปลว่า อาจมีการติดเชื้อเฉียบพลันและกำลังจะหาย แนะนำตรวจเพิ่มเติมและพบแพทย์ผู้เชี่ยวชาญเพื่อตรวจติดตามภูมิคุ้มกัน'),
(95, 5, 'Anti-HCV', 0, 0, 0, 0, 0, 0, '', '', '', 'การตรวจพบ Anti-HCV Positive  ในเลือด แปลผลว่า มีการติดเชื้อไวรัสตับอักเสบซี แนะนำตรวจเพิ่มเติมและพบแพทย์ผู้เชี่ยวชาญ');
